import React, {  Component } from 'react';
import './App.css';
import { fetchMakeupData } from '../../ApiCalls/AipCalls'
import MakeupContainer from '../MakeupContainer/MakeupContainer';
import MakeupCard from '../MakeupCard/MakeupCard';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      allMakeup: []
    }
  }

  componentDidMount = () => {
    fetchMakeupData()
      .then(makeupData => this.setState([this.allMakeup, ...makeupData]))
  }

  render() {
    return (
      <div className="App">
        {/* <MakeupContainer allMakeup={this.allMakeup}/> */}
      </div>
    );
  }
}


export default App;
